import client from './client';

export const access = ({ username, nickname, profileImage }) =>
  client.post('/api/chat_hall/access', { username, nickname, profileImage });

export const leave = ({ username, nickname }) =>
  client.post('/api/chat_hall/leave', { username, nickname });

export const guestNumber = () => client.get('/api/chat_hall/guest_number');

export const userInfo = () => client.get('/api/chat_hall/user_info');
